I finally get to make one of *the coolest* announcements I have ever gotten to make!!

With so much stoke, I get to tell you that starting today @sendfemme is free. Yes, FREE. We have converted our outdoor community into being one that you don’t have to pay to be a part of anymore. For no other reason than it being the right/best thing to do.

If you want to join @sendfemme to make friends, share/plan adventures, and/or attend our free community meetups (we do meetups for 7 different sports), now you can. No catch. TRULY lowering the barrier for women and gender minorities means removing financial barriers. So we are quite literally putting our money where our mouth is and no longer charging a membership fee for anyone who is looking to connect and make friends.

The education (workshops, webinars and courses) are behind paywalls. You now have the option to pay $10/month for workshops/webinars (we put on 3-4 every month) and we currently have 7 courses for purchase, ranging from $15-25 depending on the depth of the course. Once you purchase a course, it is yours forever, even when we upgrade and add to it. AND THANKS TO OUR AMAZING MEMBERS WE HAVE A SCHOLARSHIP FUND. Meaning if you can’t afford the webinars or courses, you can apply to get them covered by some of the amazing members of our community who want to pay it forward.

Now go request a free membership with the link in my bio! (Unless you are are cis male who identifies as he/him. Sorry fellas, but you can’t sit with us.)

